{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.4.0"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":19663,"sourceType":"datasetVersion","datasetId":14701},{"sourceId":8766107,"sourceType":"datasetVersion","datasetId":4907070},{"sourceId":10417255,"sourceType":"datasetVersion","datasetId":6456212},{"sourceId":4594730,"sourceType":"datasetVersion","datasetId":2677461}],"dockerImageVersionId":30749,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"# Задание 2","metadata":{}},{"cell_type":"code","source":"suppressPackageStartupMessages({\n    library(tidyverse)\n    library(cluster)\n    library(factoextra)\n})\n\n# 1. Загрузка\n# Ссылка ведет на датасет CC GENERAL.csv\n# Попробуем найти его в папке (обычно на Kaggle он лежит в /kaggle/input/ccdata/CC GENERAL.csv)\n# Но для универсальности поищем\n\ndf <- read.csv(\"/kaggle/input/ccdata/CC GENERAL.csv\")\n\n# 2. Предобработка\n# Удаляем ID\ndf_clean <- df %>% select(-CUST_ID)\n\n# Заполняем пропуски (медианой, чтобы не терять данные)\ndf_clean <- df_clean %>% mutate(across(everything(), ~ifelse(is.na(.), median(., na.rm=TRUE), .)))\n\n# Масштабирование (обязательно для Евклида)\ndf_scaled <- scale(df_clean)\n\n# 3. Кластеризация (Hierarchical: Single Linkage)\n# Считаем матрицу расстояний (Euclidean)\ndist_mat <- dist(df_scaled, method = \"euclidean\")\n\n# Строим дерево\nhc_single <- hclust(dist_mat, method = \"single\")\n\n# 4. Визуализация Дендрограммы\noptions(repr.plot.width = 16, repr.plot.height = 8)\n\n# Рисуем\nfviz_dend(hc_single, \n          k = 4, # Попробуем выделить 4 цвета, но single скорее всего покажет 1 гигантский\n          show_labels = FALSE, # Иначе будет каша из 9000 подписей\n          main = \"Дендрограмма (Single Linkage + Euclidean)\",\n          rect = TRUE)\n\n# 5. Выводы (автоматический анализ высоты)\ncat(\"\\n=== Анализ структуры ===\\n\")\ncat(\"Метод 'Single Linkage' часто приводит к эффекту цепочки.\\n\")\ncat(\"Посмотрим на распределение высот объединения:\\n\")\nprint(head(rev(hc_single$height), 10)) # Топ-10 последних объединений\n","metadata":{"_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","_execution_state":"idle","trusted":true,"execution":{"iopub.status.busy":"2026-01-03T22:40:09.920541Z","iopub.execute_input":"2026-01-03T22:40:09.953438Z","iopub.status.idle":"2026-01-03T22:40:26.679007Z","shell.execute_reply":"2026-01-03T22:40:26.677060Z"}},"outputs":[{"name":"stdout","text":"\n=== Анализ структуры ===\nМетод 'Single Linkage' часто приводит к эффекту цепочки.\nПосмотрим на распределение высот объединения:\n [1] 15.014783 12.613200 12.470990 12.196594 11.968861 11.239949 11.022879\n [8] 10.300806  9.873291  8.673661\n","output_type":"stream"}],"execution_count":2},{"cell_type":"code","source":"# Вариант 1: Самый простой и надежный (Base R)\noptions(repr.plot.width = 20, repr.plot.height = 10)\n\n# Просто строим, без наворотов\nplot(hc_single, \n     main = \"Dendrogram (Single Linkage)\", \n     xlab = \"Customers\", \n     sub = \"\",\n     labels = FALSE,  # Убираем текст снизу, чтобы не вис\n     hang = -1)       # Выравниваем ножки\n     \n# Добавляем красные рамки (попробуем выделить 3 кластера)\nrect.hclust(hc_single, k = 3, border = \"red\")\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2026-01-03T22:44:14.812118Z","iopub.execute_input":"2026-01-03T22:44:14.813760Z","iopub.status.idle":"2026-01-03T22:44:15.488224Z","shell.execute_reply":"2026-01-03T22:44:15.485264Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ5xU1cHA4TPbF1iaIAiIECNoFGMXY8GCLaCCLVZsicaISYy+tljAhr1HjYkG\nNBoJRmPFEGvsAlGMGFEQxEixwcKy7LJl3g+zDCsg7Cwsw3qe54O/y5k795