исла для кластеризации и масштабируем\ndf_numeric <- df %>% \n    select(Speed_Over_Ground_knots, Engine_Power_kW, Distance_Traveled_nm, \n           Operational_Cost_USD, Revenue_per_Voyage_USD, Efficiency_nm_per_kWh) %>%\n    na.omit()\nX_scaled <- scale(df_numeric)\n\n# 2. Строим дендрограммы (Евклид и Манхэттен + Ward)\noptions(repr.plot.width = 16, repr.plot.height = 8)\n\nd1 <- dist(X_scaled, method = \"euclidean\")\nhc1 <- hclust(d1, method = \"ward.D2\")\nplot(hc1, main = \"Дендрограмма (Euclidean + Ward)\", labels = FALSE, hang = -1, sub=\"\")\nrect.hclust(hc1, k=4, border=\"red\") # Примерное разбиение\n\nd2 <- dist(X_scaled, method = \"manhattan\")\nhc2 <- hclust(d2, method = \"ward.D2\")\nplot(hc2, main = \"Дендрограмма (Manhattan + Ward)\", labels = FALSE, hang = -1, sub=\"\")\nrect.hclust(hc2, k=4, border=\"blue\")\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2026-01-03T22:58:41.636934Z","iopub.execute_input":"2026-01-03T22:58:41.639171Z","iopub.status.idle":"2026-01-03T22:58:43.274860Z","shell.execute_reply":"2026-01-03T22:58:43.272996Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAB4AAAAPACAIAAABb1/PuAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xV5cEH8CebMMNSljgQERGsIoJ7IqhF0ApWraivOOpslVpHLVpHtQ7qLiqK\nojhw1brqqLUORERRRNkgosgmQAZZ9/3jhkuAEBLkcIl8v3/4eXLOc8/5ndxLPvjjyTkpsVgs\nAAAAAADA5paa7AAAAAAAAPw8KaABAAAAAIiEAhoAAAAAgEgooAEAAAAAiIQCGgAAAACASCig\nAQAAAACIhAIaAAAAAIBIKKABAAAAAIiEAhoAAAAAgEgooAEAAAAAiIQCGgAAAACASCigAQAA\nAACIhAIaAAAAAIBIKKABAAAAAIiEAhoAAAAAgEgooAEAAAAAiIQCGgAAAACASCigAQAAAACI\nhAIaAAAAAIBIKKABAAAAAIiEAhoAAAAAgEgooAEAAAAAiIQCGgAAAACASCigAQAAAACIhAIa\nAAAAAIBIKKABAAAAAIiEAhoAAAAAgEgooAEAAAAAiIQCGgAAAACASCigAQAAAACIhAIaAAAA\nAIBIKKABAAAAAIiEAhoAAAAAgEgooAEAAAAAiIQCGgAAAACASCigAQAAAACIhAIaAAAAAIBI\nKKABAAAAAIiEAhoAAAAAgEgooAEANqJuWmpKlRrucEWyM7IVmfPKeSkpKampGU/OywshlBRM\nrvrzE1evef9IU80f+8vEuWavKq1i44ZUvJDjv1gYadpkGfPbPRLXOGjS4oq75n14YmLXfrdN\nrLirYNHoxK7t9hkeacJK34XcGffEt1z1wY