MXvXJ0YUt4s4CAAC7hwIaAIBma/ns\n0T3P21Dxflks24DsrDu+23n6QWX/uHpg3EEAAGC3SY87AAAARKX4mP/+1aANd7xTGXeQHUtW\nvfZQ1uDHrxwQdxAAANidrIAGAAAAACASVkADAAAAABAJBTQAAAAAAJFQQAMAAAAAEAkFNAAA\nAAAAkVBAAwAAAAAQCQU0AAAAAACRUEADAAAAABAJBTQAAAAAAJFQQAMAAAAAEIn/BxBJtHTO\nb+p9AAAAAElFTkSuQmCC"},"metadata":{"image/png":{"width":960,"height":480}}}],"execution_count":26},{"cell_type":"markdown","source":"По дендрограммам видно, что лучше выделить 4 кластера. На em алгоритм надежды нет, чем больший лимит для кластеров я ему кормил, тем большее оптимальное количество кластеров он мне давал. Я остановился на 4, к тому же есть столбец ship type, там как раз 4 типа судов + значения none, но там непонятно, либо данных нет, либо просто другой тип кораблей, который решили не выделять","metadata":{}},{"cell_type":"code","source":"\n# --- Блок 3: Анализ и полная таблица ---\ndf_final <- df_numeric\ndf_final$Cluster <- factor(gmm$classification)\n\n# Считаем средние\ncluster_summary <- df_final %>%\n    group_by(Cluster) %>%\n    summarise(across(everything(), mean),\n              Count = n())\n\nprint(as.data.frame(cluster_summary))","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2026-01-03T23:21:04.932219Z","iopub.execute_input":"2026-01-03T23:21:04.933886Z","iopub.status.idle":"2026-01-03T23:21:04.973347Z","shell.execute_reply":"2026-01-03T23:21:04.970950Z"}},"outputs":[{"name":"stdout","text":"  Cluster Speed_Over_Ground_knots Engine_Power_kW Distance_Traveled_nm\n1       1                17.70029        1737.491            1309.3710\n2       2                17.59263        1716.538            1241.8838\n3       3                17.52144        1798.109            1257.7755\n4       4                17.58571        1769.960             295.5844\n  Operational_Cost_USD Revenue_per_Voyage_USD Efficiency_nm_per_kWh Count\n1             252988.6               544523.8             1.2296414   792\n2             406936.6               514736.9             0.5203168   541\n3             147291.0               521292.8             0.5011274   740\n4             254234.1               499177.0             0.8430166   663\n","output_type":"stream"}],"execution_count":27},{"cell_type":"markdown","source":"Выше я писал, что возьму 4 кластера, потому что они должны хорошо интерпретироваться. Фатальная ошибка. Например, кластер 1. Скорость такая же как у всех, мощность тоже средняя относительно других, преодолеваемое расстояние почти такое же, как у судов в клстерах 2,3. Средняя стоимость, зато по эффективности они выше других. Ни в один тип судов это не вписывается. Пробовал разбивать на другое количество кластеров, ничего особо не меняется.\n\n*Датасет синтетический...* ( ◡‿◡ *)","metadata":{}},{"cell_type":"markdown","source":"# Задание 4","metadata":{}},{"cell_type":"code","source":"# Загрузка библиотек\nlibrary(tidyverse)\nlibrary(cluster)\nlibrary(factoextra)\n\n# Загрузка данных\nattendance <- read_csv(\"/kaggle/input/school-student-daily-attendance/2018-2019_Daily_Attendance_20240429.csv\")\n\n# 1. Feature Engineering и Агрегация\nschool_summary <- attendance %>%\n  mutate(\n    # Создаем относительный показатель отсутствия (доля от зачисленных)\n    Absent_Rate = Absent / Enrolled\n  ) %>%\n  group_by(`School DBN`) %>%\n  summarise(\n    Avg_Enrolled = mean(Enrolled, na.rm = TRUE),\n    Avg_Absent_Rate = mean(Absent_Rate, na.rm = TRUE),\n    # Добавляем вариативность посещаемости (стабильность школы)\n    SD_Absent_Rate = sd(Absent_Rate, na.rm = TRUE)\n  ) %>%\n  ungroup() %>%\n  na.omit() # Убираем строки, если где-то sd дал NA (одиночные записи)\n\n# 2. Масштабирование (Scaling)\n# Обязательно для кластеризации, чтобы численность (сотни) не доминировала над процентами (0.05)\nschool_scaled <- school_summary %>%\n  select(-`School DBN`) %>%\n  scale() %>%\n  as.data.frame()\n\n# Добавляем названия школ как имена строк для удобства\nrownames(school_scaled) <- school_summary$`School DBN`\n\n# 3. Проверка результата\nprint(paste(\"Количество школ для кластеризации:\", nrow(school_scaled)))\nhead(school_scaled)\nsummary(school_scaled)\n\n# 4. Проверка корреляций (важно, чтобы не кластеризовать по дублирующим признакам)\ncor(school_scaled)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2026-01-03T23:30:10.693389Z","iopub.execute_input":"2026-01-03T23:30:10.695000Z","iopub.status.idle":"2026-01-03T23:30:11.101546Z","shell.execute_reply":"2026-01-03T23:30:11.099689Z"}},"outputs":[{"name":"stderr","text":"\u001b[1mRows: \u001b[22m\u001b[34m277153\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m6\u001b[39m\n\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n\u001b[1mDelimiter:\u001b[22m \",\"\n\u001b[31mchr\u001b[39m (1): School DBN\n\u001b[32mdbl\u001b[39m (5): Date, Enrolled, Absent, Present, Released\n\n\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n","output_type":"stream"},{"name":"stdout","text":"[1] \"Количество школ для кластеризации: 1581\"\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 6 × 3</caption>\n<thead>\n\t<tr><th></th><th scope=col>Avg_Enrolled</th><th scope=col>Avg_Absent_Rate</th><th scope=col>SD_Absent_Rate</th></tr>\n\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><th scope=row>01M015</th><td>-0.8659731</td><td>-0.3673938</td><td>-0.0719322</td></tr>\n\t<tr><th scope=row>01M019</th><td>-0.7043265</td><td>-0.1600396</td><td> 0.4316751</td></tr>\n\t<tr><th scope=row>01M020</th><td>-0.2374953</td><td>-0.2861696</td><td>-0.4091490</td></tr>\n\t<tr><th scope=row>01M034</th><td>-0.5906483</td><td> 0.2123481</td><td> 1.1524586</td></tr>\n\t<tr><th scope=row>01M063</th><td>-0.748