поэтому были посчитани относительные показатели размера контингента, уровня пропусков и стабильности посещаемости. Если так не сделать, то все поплывет, потому что очевидно, что в большой школе, число прогуливающих больше, чем в маленькой. \nAvg_Absent_Rate и SD_Absent_Rate хорошо коррелируют, а размер школы с пропусками коррелирует уже похуже (-0.25).","metadata":{}},{"cell_type":"code","source":"set.seed(123) # Для воспроизводимости\n\n# 1. Метод локтя (Elbow Method)\n# Ищем точку перегиба, где падение ошибки замедляется\nfviz_nbclust(school_scaled, kmeans, method = \"wss\") +\n  labs(title = \"Метод локтя (Within Sum of Squares)\")\n\n# 2. Метод силуэта (Silhouette Method)\n# Ищем пик, где кластеры максимально плотные и разделенные\nfviz_nbclust(school_scaled, kmeans, method = \"silhouette\") +\n  labs(title = \"Метод силуэта (Average Silhouette Width)\")\n\n# 3. Gap Statistic (статистика разрыва)\n# Сравнивает нашу кластеризацию со случайным распределением\ngap_stat <- clusGap(school_scaled, FUN = kmeans, nstart = 25,\n                    K.max = 10, B = 50) # B = 50 итераций bootstrap\n\nfviz_gap_stat(gap_stat) +\n  labs(title = \"Gap Statistic Method\")\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2026-01-03T23:49:09.626152Z","iopub.execute_input":"2026-01-03T23:49:09.627727Z","iopub.status.idle":"2026-01-03T23:49:44.325670Z","shell.execute_reply":"2026-01-03T23:49:44.323583Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAB4AAAAPACAIAAABb1/PuAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AU1d7H8f9sS+8dQoAQIIUqSFV6sYENsWJFQUSvV0VFr9jrRQEboCAKiOLl\nQcFClaaAFAlFQiCBQGiBkN6T3Z3nxUJIAzaQzaR8P6/CmbMzvzO78cUv41lFVVUBAAAAAAAA\nAKCm6bQOAAAAAAAAAABomCigAQAAAAAAAAAOQQENAAAAAAAAAHAICmgAAAAAAAAAgENQQAMA\nAAAAAAAAHIICGgAAAAAAAADgEBTQAAAAAAAAAACHoIAGAAAAAAAAADgEBTQAAAAAAAAAwCEo\noKuQf2q2oiiKouh0umUZhReZ+XGHANvM5tevrrV4sN8vT3b0aHp3sSopm++yvVNfpuRVnvZR\nW19FUQwm/wyzWvnoVR5OiqKEDlgiIkdXDFEUJSDmp4tcNCPhEUVRfFpNuWQ8e852Gfa