5160u8+dzp\nhvi/fpOaYF0AAPxVAjQAAAAAAEH4BQcAAAAAAEEI0AAAAAAABCFAAwAAAAAQhAANAAAAAEAQ\nAjQAAAAAAEEI0AAAAAAABCFAAwAAAAAQhAANAAAAAEAQAjQAAAAAAEEI0AAAAAAABCFAAwAA\nAAAQhAANAAAAAEAQAjQAAAAAAEEcAXCHETvZGznLAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"width":960,"height":480}}}],"execution_count":31},{"cell_type":"code","source":"set.seed(123)\n\n# --- 1. K-Means Clustering ---\nkmeans_model <- kmeans(school_scaled, centers = 4, nstart = 25)\n\n# --- 2. Hierarchical Clustering (Ward) ---\ndist_matrix <- dist(school_scaled, method = \"euclidean\")\nhc_ward <- hclust(dist_matrix, method = \"ward.D2\")\ngrp_ward <- cutree(hc_ward, k = 4)\n\n# --- 3. Hierarchical Clustering (Single Linkage) ---\n# Проверяем \"плохой\" метод для отчета\nhc_single <- hclust(dist_matrix, method = \"single\")\ngrp_single <- cutree(hc_single, k = 4)\n\n# --- 4. Оценка качества (Silhouette Score) ---\n# Функция для быстрого расчета среднего силуэта\nget_sil_score <- function(model_clusters, data_dist) {\n  ss <- silhouette(model_clusters, data_dist)\n  mean(ss[, 3])\n}\n\nscores <- data.frame(\n  Method = c(\"K-Means\", \"Hierarchical (Ward)\", \"Hierarchical (Single)\"),\n  Silhouette = c(\n    get_sil_score(kmeans_model$cluster, dist_matrix),\n    get_sil_score(grp_ward, dist_matrix),\n    get_sil_score(grp_single, dist_matrix)\n  )\n)\n\nprint(scores)\n\n# --- 5. Визуализация лучшей модели (обычно K-means или Ward) ---\n# Рисуем K-means для детального разбора\nfviz_cluster(kmeans_model, data = school_scaled,\n             geom = \"point\",\n             ellipse.type = \"convex\", \n             ggtheme = theme_minimal()) +\n  labs(title = \"Результат кластеризации K-Means (k=4)\")\n\n# Смотрим, сколько школ попало в каждый кластер (проверка баланса)\ntable(kmeans_model$cluster)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2026-01-03T23:59:45.444040Z","iopub.execute_input":"2026-01-03T23:59:45.445777Z","iopub.status.idle":"2026-01-03T23:59:46.354658Z","shell.execute_reply":"2026