marketing/Customer marketing.csv\", delim = \"\\t\") # Внимание! Обычно этот файл с табуляцией\n\n\ndf_clean <- df %>%\n  mutate(\n    Age = 2025 - Year_Birth, \n    Total_Spent = MntWines + MntFruits + MntMeatProducts + MntFishProducts + MntSweetProducts + MntGoldProds,\n    Family_Size = 1 + ifelse(Marital_Status %in% c(\"Married\", \"Together\"), 1, 0) + Kidhome + Teenhome,\n    Is_Parent = ifelse(Kidhome + Teenhome > 0, 1, 0)\n  ) %>%\n  filter(Age < 100, Income < 600000) %>% \n  drop_na() \n\ndf_clustering <- df_clean %>%\n  select(Income, Recency, Age, Total_Spent, Family_Size, \n         NumWebPurchases, NumStorePurchases, NumDealsPurchases)\n\n# Масштабирование\ndf_scaled <- scale(df_clustering)\n\n# Проверка\nprint(paste(\"Осталось клиентов:\", nrow(df_scaled)))\nsummary(df_clustering)\ncor(df_clustering)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2026-01-04T00:06:59.327327Z","iopub.execute_input":"2026-01-04T00:06:59.328956Z","iopub.status.idle":"2026-01-04T00:06:59.491416Z","shell.execute_reply":"2026-01-04T00:06:59.489429Z"}},"outputs":[{"name":"stderr","text":"\u001b[1mRows: \u001b[22m\u001b[34m2240\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m29\u001b[39m\n\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n\u001b[1mDelimiter:\u001b[22m \"\\t\"\n\u001b[31mchr\u001b[39m  (3): Education, Marital_Status, Dt_Customer\n\u001b[32mdbl\u001b[39m (26): ID_, Year_Birth, Income, Kidhome, Teenhome, Recency, MntWines, Mnt...\n\n\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n","output_type":"stream"},{"name":"stdout","text":"[1] \"Осталось клиентов: 2212\"\n","output_type":"stream"},{"output_type":"display_data","data":{"text/plain":"     Income          Recency           Age         Total_Spent    \n Min.   