, 50)) +\n  labs(title = \"Scree Plot: Сколько информации несет каждая компонента?\")\n\n# 3. Вклад признаков\nfviz_pca_var(pca_res, col.var = \"contrib\",\n             gradient.cols = c(\"#00AFBB\", \"#E7B800\", \"#FC4E07\"),\n             repel = TRUE) +\n  labs(title = \"Вклад переменных в главные компоненты\")","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2026-01-04T00:23:54.279027Z","iopub.execute_input":"2026-01-04T00:23:54.280745Z","iopub.status.idle":"2026-01-04T00:23:55.336043Z","shell.execute_reply":"2026-01-04T00:23:55.333887Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAB4AAAAPACAIAAABb1/PuAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ4AV5fk34Odsb/QmIKhURREVGwI2wFhir9hijYmaGLvGErtGY0sUxRhLYu+9\nd81fY+9gCSIqTXapy/ad98PiuiwLnF129hzyXteXcJ7zzMw9M/ccs7+dnZOIoigAAAAAAEBr\ny0h1AQAAAAAA/G8SQAMAAAAAEAsBNAAAAAAAsRBAAwAAAAAQCwE0AAAAAACxEEADAAAAABAL\nATQAAAAAALEQQAMAAAAAEIvVNYCuKZ/2j0tPGrfVht06tc/OymnfpdfwbXc752/3za+JUl3a\nyvXKzUosLSMjo7B9p/W3GHvWdQ9WNNiDj/+8WSKRGPPo1DatL6p87rarDt1t6359ehbk5HTo\nssbwbX555jV3T6+oadMyAGhVi6a+euohuw7u3S0/J6dDl16jdjr4thempLooAAAA/sclomg1\nSGwbWTTtye023ffdH8sSGTlr9F2nb4/2C2ZPmzx1dhRFHQbu+vy7D2zWPifVNa5Ir9ysGZU1\nPfv1L8xI1I1ENYu/+3ZGZW0UQug79pyvn7sgOxFCCB//ebNhZ7y7/SPfvLj72kmuPKot/b83\nP8zK7bvFpn1aUFvpDy/u+4v9nv6sJISQldeuR48u1QtnzypZHELI7775Dc8+/auNOrdgtQCk\n1sJv79lg3UOmlVcX9Oi//todZ/530ndzFicSmQdPeO+fvxmW6uoAAAD4n7Ua3gEdVR4x4oB3\nfyxbd59zPpk+b/o3k9966+3Pp8ycM/m1Y0b3nP/V4zuNPjvVJSbl5nc//eonX0/5oaxs3uPX\nHZ+dSEx74cJDnpzW4tVWl305atSoHfb+ewuWrSh5ZYt1d376s5I1Rx54/8sfLlq84Pup38ws\nLp0+6bXT9t6gbPbbR40Y/tLcihbXRiP3bTO0T58+9/xYlupCgP99f9nx2Gnl1ePOf3jejK/f\nfuvdabPnPn7tkVFUc9fvx35SWpXq6gAAAPiftfoF0POnXnD/9EV5nca+e+/56/fIrx/vPGjU\nhBfeG1aUU/zxFVd8vzCFFbZMRk77Xx73twf26xdCePGPz6WkhtO23eezRZX99rn8q9fu3Gfb\nYblL7s8OPdcd/ecHPrxgRI/q8qm/2v+RlNT2P6l05vTvv/++tHb1+ysEYPVSXTb5oi/m5bYf\n8dQ5e9T9hU1I5Pzy9zdfOKBjTdWcP31UnOL6AAAA+N+1+gXQcz9+M4RQ2ONX9c+vqJeR0/PC\nYV1DCC9909IAOqqYXVW7agWukhFnDAshLJ75Yttvuv