м ~80% дисперсии)\ndf_pca_4 <- as.data.frame(pca_res$x[, 1:4])\n\nset.seed(42)\n\n# 1. Выбор k (Elbow и Silhouette) на 4 компонентах\np1 <- fviz_nbclust(df_pca_4, kmeans, method = \"wss\") + labs(title = \"Elbow Method (4 PCs)\")\np2 <- fviz_nbclust(df_pca_4, kmeans, method = \"silhouette\") + labs(title = \"Silhouette Method (4 PCs)\")\n\nprint(p1)\nprint(p2)\n\n# 2. Кластеризация (k определим по графикам, пока ставим 4 как гипотезу)\nfinal_k <- 4\nkmeans_final <- kmeans(df_pca_4, centers = final_k, nstart = 25)\n\n# 3. Визуализация (показываем проекцию на первые 2 оси, но кластеры считались в 4D)\nfviz_cluster(kmeans_final, data = df_pca_4,\n             choose.vars = c(\"PC1\", \"PC2\"), # Явно указываем оси для рисовки\n             geom = \"point\",\n             ellipse.type = \"convex\",\n             ggtheme = theme_minimal()) +\n  labs(title = \"Сегментация клиентов (на основе 4 компонент)\")\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2026-01-04T00:23:57.241500Z","iopub.execute_input":"2026-01-04T00:23:57.243284Z","iopub.status.idle":"2026-01-04T00:24:00.826661Z","shell.execute_reply":"2026-01-04T00:24:00.824501Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAB4AAAAPACAIAAABb1/PuAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdaYCWZb0/8N8zKzPMwLCDrIOIioigbC5ppZlLKqClttfxZFn2b1HLU3nqlLnk\nUh5Ls/KUZWUmiOZepmnKpsjihsoMmyzDOgwzzPr8XwwRIMuADPcsn8+r4bqv57q/z/2MvPhy\neT2pdDodAAAAAACwv2UkHQAAAAAAgLZJAQ0AAAAAQLNQQAMAAAAA0CwU0AAAAAAANAsFNAAA\nAAAAzUIBDQAAAABAs1BAAwAAAADQLBTQAAAAAAA0CwU0AAAAAADNQgG9jy7tW5jak0Mu/Efj\n5LI5Z6dSqa6H3Nb4xz8e3j2VSp09pyy5+LtUWfb7rfmnrNm8m5l3juvdOO2gYx959/dd98Z/\npFKpLgff/O6XaopjCnNTqdTfN1Q3ZfJfLj2qsO+FNeldTnjz3p9effXVr1XVNWW1K/p3euev\nSkZGduduvUa/90Pf/8WD1bu4UUXpcz+44uITRx7au1vn7Oy8br36HXvKhO/ddt/auoam3Hcb\nDV84uOjQT/1+L18FAAAAAHtNAc0uXf3z13d1qaFm+eWz31WBfsv/fPc73/nOkur6d7PIAbDu\n1Zsn/HTeJVNvyUntfMKmZZPHfezL3/72t1+prN3nu6TTdeVrV73w9ENXfe7sg0/68ob6HUvo\nqT+4sPeQ93znR3c8M2fByrXldXWb165aNu