0CwooAEAAAAAiIRLpQAAAAAA\nEAkFNAAAAAAAkVBAAwAAAAAQCQU0AAAAAACRUEADAAAAABAJBTQAAAAAAJFQQAMAAAAAEAkF\nNAAAAAAAkVBAAwAAAAAQCQU0AAAAAACRUEADAAAAABAJBTQAAAAAAJH4v1yl+pMWi/iHAAAA\nAElFTkSuQmCC"},"metadata":{"image/png":{"width":960,"height":480}}}],"execution_count":46},{"cell_type":"markdown","source":"Так-с. По поводу того, что происходило выше. Метод силуэта предлагал два кластера, но это делать особо смысла нет, потому что там 100% будет деление на богатых и бедных или одиноких и семьи. Взял 4 кластера. На графике кластеризации два кластера наложилось друг на друга, но это из-за проекции 4-ехмерного пространства (4 компонента) на двумерное.\nИнтерпретация результатов\nКластер 1 - высокий доход, детей нет, высокие траты. На скидки реагируют плохо.\nКластер 2 - относительно средний доход, в среднем больше одного ребенка в семье. Чаще других пользуются скидками. Активнее других делают онлайн покупки\nКластеры 3 и 4 - они почти не отличаются, похорошему их надо объеденить в один. Низкий доход, минимальные траты, в зачастую есть дети. Магазинами соответственно, пользуются реже других групп","metadata":{}}]}